package ccxt

type Cryptomus struct {
	*CryptomusCore
	Core          *CryptomusCore
	exchangeTyped *ExchangeTyped
}

func NewCryptomus(userConfig map[string]interface{}) *Cryptomus {
	p := NewCryptomusCore()
	p.Init(userConfig)
	return &Cryptomus{
		CryptomusCore: p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewCryptomusFromCore(core *CryptomusCore) *Cryptomus {
	return &Cryptomus{
		CryptomusCore: core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

